type InterestPaid = {
  name: string;
  periods: number;
};

const interestPaidFrequency: InterestPaid[] = [
  {
    name: "Monthly",
    periods: 12,
  },
  {
    name: "Quarterly",
    periods: 4,
  },
  {
    name: "Annually",
    periods: 1,
  },
  {
    name: "At Maturity",
    periods: 1,
  },
];

export { interestPaidFrequency };
